* {
	margin: 0;
	padding: 0;
}

body {
	background-color: #ff0000;
}

div {
	margin: auto;
	position: absolute;
	background-color: #fff;
	border-radius: 20px;
	width: 300px;
	height: 350px;
	text-align: center;
	top: 0;
	left: 0;
	right: 0;
	bottom: 0;
	padding-top: 50px;
}

input {
	margin-top: 10px;
	width: 200px;
	height: 30px;
	border-radius: 20px;
	outline:none; 
	text-align: center;
	border: 2px solid #ff0000;
}

