	width: 150px;
	height: 50px;
	border-radius: 30px;
	margin: 20px;
	border: 2px dashed #ff0000;
	background-color: #ff0000;
	color: #fff;
	font-weight: bold;
}

p {
	text-align: left;
	margin-left: 50px;
}
